import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FaBuilding, FaHome, FaIndustry, FaPencilRuler, FaCogs, FaLeaf } from 'react-icons/fa';

const Services = () => {
  const [ref, inView] = useInView({
    threshold: 0.1,
    triggerOnce: true,
  });

  const services = [
    {
      icon: <FaBuilding className="text-4xl" />,
      title: "Commercial Construction",
      description: "Modern office buildings, retail spaces, and commercial complexes designed for success.",
      features: ["Office Buildings", "Shopping Centers", "Hotels & Resorts", "Restaurants"]
    },
    {
      icon: <FaHome className="text-4xl" />,
      title: "Residential Projects",
      description: "Luxury homes and residential communities that combine comfort with sophisticated design.",
      features: ["Custom Homes", "Apartment Complexes", "Townhouses", "Luxury Villas"]
    },
    {
      icon: <FaIndustry className="text-4xl" />,
      title: "Industrial Construction",
      description: "Robust industrial facilities and warehouses built for efficiency and durability.",
      features: ["Manufacturing Plants", "Warehouses", "Distribution Centers", "Industrial Parks"]
    },
    {
      icon: <FaPencilRuler className="text-4xl" />,
      title: "Architectural Design",
      description: "Innovative architectural solutions that blend aesthetics with functionality.",
      features: ["Concept Design", "3D Modeling", "Interior Design", "Landscape Design"]
    },
    {
      icon: <FaCogs className="text-4xl" />,
      title: "Project Management",
      description: "Comprehensive project management ensuring timely delivery and quality control.",
      features: ["Planning & Scheduling", "Cost Control", "Quality Assurance", "Risk Management"]
    },
    {
      icon: <FaLeaf className="text-4xl" />,
      title: "Sustainable Building",
      description: "Green building solutions that prioritize environmental responsibility and energy efficiency.",
      features: ["LEED Certification", "Energy Efficiency", "Green Materials", "Solar Integration"]
    }
  ];

  return (
    <section id="services" className="section-padding bg-white">
      <div className="container-custom">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-display font-bold text-gray-900 mb-6">
            Our <span className="text-gradient">Services</span>
          </h2>
          <p className="text-xl text-gray-600 max-w-3xl mx-auto">
            Comprehensive construction and architectural services tailored to meet your vision 
            and exceed your expectations.
          </p>
        </motion.div>

        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {services.map((service, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 30 }}
              animate={inView ? { opacity: 1, y: 0 } : {}}
              transition={{ duration: 0.6, delay: index * 0.1 }}
              whileHover={{ y: -10 }}
              className="bg-white rounded-2xl shadow-lg hover:shadow-2xl transition-all duration-300 p-8 border border-gray-100"
            >
              <div className="text-primary-600 mb-6 flex justify-center">
                {service.icon}
              </div>

              <h3 className="text-2xl font-display font-bold text-gray-900 mb-4 text-center">
                {service.title}
              </h3>

              <p className="text-gray-600 mb-6 text-center leading-relaxed">
                {service.description}
              </p>

              <ul className="space-y-2">
                {service.features.map((feature, featureIndex) => (
                  <li key={featureIndex} className="flex items-center text-sm text-gray-600">
                    <div className="w-2 h-2 bg-primary-600 rounded-full mr-3"></div>
                    {feature}
                  </li>
                ))}
              </ul>
            </motion.div>
          ))}
        </div>

        {/* Process Section */}
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 0.8 }}
          className="mt-20 bg-gradient-to-r from-primary-600 to-primary-800 rounded-3xl p-8 md:p-12 text-white"
        >
          <div className="text-center mb-12">
            <h3 className="text-3xl md:text-4xl font-display font-bold mb-6">
              Our Process
            </h3>
            <p className="text-xl opacity-90 max-w-3xl mx-auto">
              A systematic approach to delivering exceptional results
            </p>
          </div>

          <div className="grid md:grid-cols-4 gap-8">
            {[
              {
                step: "01",
                title: "Consultation",
                description: "Understanding your vision and requirements"
              },
              {
                step: "02",
                title: "Design",
                description: "Creating detailed plans and 3D models"
              },
              {
                step: "03",
                title: "Construction",
                description: "Executing the project with precision"
              },
              {
                step: "04",
                title: "Completion",
                description: "Delivering your dream project on time"
              }
            ].map((process, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, scale: 0.8 }}
                animate={inView ? { opacity: 1, scale: 1 } : {}}
                transition={{ duration: 0.6, delay: 1 + index * 0.1 }}
                className="text-center"
              >
                <div className="w-16 h-16 bg-white/20 rounded-full flex items-center justify-center mx-auto mb-4">
                  <span className="text-2xl font-bold">{process.step}</span>
                </div>
                <h4 className="text-xl font-semibold mb-2">{process.title}</h4>
                <p className="text-sm opacity-80">{process.description}</p>
              </motion.div>
            ))}
          </div>
        </motion.div>

        {/* Call to Action */}
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8, delay: 1.4 }}
          className="mt-16 text-center"
        >
          <div className="bg-gray-50 rounded-2xl p-8 md:p-12">
            <h3 className="text-3xl font-display font-bold text-gray-900 mb-4">
              Ready to Start Your Project?
            </h3>
            <p className="text-lg text-gray-600 mb-8 max-w-2xl mx-auto">
              Let's discuss your vision and create something extraordinary together. 
              Our team is ready to bring your ideas to life.
            </p>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              onClick={() => {
                const element = document.querySelector('#contact');
                if (element) {
                  element.scrollIntoView({ behavior: 'smooth' });
                }
              }}
              className="btn-primary text-lg px-8 py-4"
            >
              Get Free Consultation
            </motion.button>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Services;
